script: |
  super -f text -I q10645.spq | sort > q10645.out

inputs:
  - name: q10645.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE ( - + 63 + - - 1 ) NOT BETWEEN col0 + col0 * col0 / - col0 + col0 * + 7 AND NULL;
  - name: tab2

outputs:
  - name: q10645.out
    data: |
      46	51	23
      64	77	40
      75	67	58
